/*************************************************/
/***************TILE CREATION*********************/
/*************************************************/
var tiles=[];
initTiles();

function tileObject(imgSrc,walkable)
{
  this.imgSrc=imgSrc;
  this.walkable = walkable;
}
function tileWalkable(y,x)
{
  if(enemyOnTile(y,x))
    return 0;

  //return if the tile is walkable (0 or 1)
  return tiles[map3[x][y]].walkable;
}
function initTiles()
{

  var httpImgSrc = '../images/sprites/16x16_Tileset/GrassDirt/';
  var walkable =1;
  for(var i=0;i<16;i++)
  {
    if(i<10)
      var imgSrc = httpImgSrc+'Outdoors_0'+i+'.png';
    else
      var imgSrc = httpImgSrc+'Outdoors_'+i+'.png';

    if(i==15)
      tiles[i]=new tileObject(imgSrc,0);
    else
      tiles[i]=new tileObject(imgSrc,1);
  }
}



/*************************************************/
/***************  MAP CREATION  ******************/
/*************************************************/

// this will tell my loop where to start printing on the canvas
var printPosX = 0;
var printPosY =0;

function drawMap()
{
    //context2.clearRect(0, 0, canvas.width, canvas.height);
    //context.requestAnimationFrame(displayMap);
    for (var i = playerPosY-9; i<=playerPosY+9 ; i++)//columns
    {
      for (var j= playerPosX-9; j<=playerPosX+9 ; j++)//rows
      {
        //creates a new image object
        var image = new Image();

        //condition will determin if the spot that will be displayed is on the map3
        //if not then it will display a dirt tile(for now);
        if(i<0||i>map3.length-1)
          image.src = tiles[15].imgSrc;
        else if(j<0||j>map3[i].length-1)
          image.src = tiles[15].imgSrc;
        else
          image.src = tiles[map3[i][j]].imgSrc;

        //draw the image to the screen//last two variables are the sprite size
        context.drawImage(image,printPosX,printPosY,16,16);
        //adjust 1 sprite width over
        printPosX+=16;
     }
     printPosX=0;//reset to left of screenaaa
     printPosY+=16;//drop down 1 sprite size

    }
    printPosX=0;//reset both to top left
    printPosY=0;
}


